    const PBKDF2_ITERATIONS = 100000;

    function base64ToArrayBuffer(b64) {
      const binary = atob(b64);
      const len = binary.length;
      const bytes = new Uint8Array(len);
      for (let i = 0; i < len; i++) {
        bytes[i] = binary.charCodeAt(i);
      }
      return bytes.buffer;
    }

    function stringToArrayBuffer(str) {
      return new TextEncoder().encode(str);
    }

    function arrayBufferToString(buf) {
      return new TextDecoder().decode(buf);
    }

            hash: "SHA-256"
          },
          baseKey,
          {
            name: "AES-GCM",
            length: 256
          },
          false,
          ["decrypt"]
        );

        const plaintextBuf = await crypto.subtle.decrypt(
          {
            name: "AES-GCM",
            iv: new Uint8Array(base64ToArrayBuffer(IV_B64))
          },
          aesKey,
          ciphertext
        );

        const html = arrayBufferToString(plaintextBuf);
        document.open();
        document.write(html);
        document.close();
      } catch (e) {
        console.error(e);
        errorEl.textContent = "Decryption failed. Wrong password.";
      }
    }

    document.getElementById('unlockForm').addEventListener('submit', function(e) {
      e.preventDefault();
      const pw = (document.getElementById('pw').value || "").trim();
      if (!pw) {
        document.getElementById('error').textContent = "Please enter a password.";
        return;
      }
      unlockWithPassword(pw);
    });
  </script>
</body>
</html>
